import React, {Component} from 'react'
import Mobiles from './components/phones';
import './App.css'

class App extends Component {
  render() {
    <Mobiles mobiles = {this.state.mobiles}/>
    return (
      <div>
        <h1>List of available mobiles</h1>
        {mobiles.map((mobile) => (
          <div class="mobile">
              <h1>name:{mobile.name}</h1>
              <h2>price:{mobile.price}</h2>
          </div>
        ))}
      </div>
  )
  }

  state = {
      mobiles: []
  };

  componentDidMount() {
      fetch('http://localhost:8080/phones')
          .then(res => res.json())
          .then((data) => {
              this.setState({ mobiles: data })
          })
          .catch(console.log)

  }
}

export default App;
